import React from "react";
import {
  Card,
  CardBody,
  CardFooter,
  CardImg,
  CardSubtitle,
  CardText,
  CardTitle,
  Button,
} from "reactstrap";

const BlogCard = (props) => {
  return (
    <React.Fragment style={{ "overflow-y": "scroll" }}>
      <Card>
        <CardTitle>{props.title}</CardTitle>
        <CardSubtitle>{props.subtitle}</CardSubtitle>
        <CardImg top width="300%" height="30%" src={props.media} />
        <CardBody>
          <CardText>{props.description}</CardText>
        </CardBody>
        <CardFooter>
          <Button color="info" size="sm">
            Like
          </Button>
          <Button color="info" size="sm">
            Comment
          </Button>
        </CardFooter>
      </Card>
    </React.Fragment>
  );
};

export default BlogCard;
